import React from "react";
import { Container, Nav, Navbar, NavbarBrand } from "react-bootstrap";
import logo from "../../assets/jmlogo.png";

export default function MiddleNavBar() {
  return (
    <>
      <Container>
        <Nav style={{ width: "100%", height: "100px" }}>
          <NavbarBrand className="mx-auto d-none d-lg-block .d-xl-none">
            <img src={logo} width={100} height={100} alt="jmlogo" />
          </NavbarBrand>
        </Nav>
      </Container>
    </>
  );
}
